        "import numpy as np\n",
        "#Numpyのインポート\n",
        "import matplotlib.pyplot as plt\n",
        "#matplotlib.pyplotをインポート\n",
        "#①格子点の座標を用意\n",
        "x = np.arange(-5, 6)\n",
        "#-5~5の整数を用意\n",
        "y = np.arange(-5, 6)\n",
        "#上と同じ\n",
        "X, Y = np.meshgrid(x, y)\n",
        "#格子点座標の作成\n",
        "#②各点ごとの値を用意\n",
        "data = X**2 - Y**2\n",
        "#格子点ごとのデータを作成\n",
        "#③等高線を描画\n",
        "plt.contourf(X, Y, data)\n",
        "#等高線をプロット\n",
        "plt.show()\n",
        "#画像の表示\n",
        "\n",
        "print(data)"
