        "import numpy as np\n",
        "import matplotlib.pyplot as plt\n",
        "from matplotlib import animation, rc\n",
        "from IPython.display import HTML\n",
        "\n",
        "#環境設定\n",
        "c = 340     #音速 m/s\n",
        "f = 40000     #周波数 Hz\n",
        "T = 1 / f   #周期 s\n",
        "ramda = c / f   #波長 m\n",
        "beta = 2 * np.pi / ramda    #位相定数\n",
        "omega = 2 * np.pi / T       #角周波数\n",
        "\n",
        "x_range = np.linspace(4*np.pi/beta, 0, 100)\n",
        "t_range = np.linspace(0,2*np.pi/omega, 100)\n",
        "X, Y = np.meshgrid(x_range, t_range)\n",
        "\n",
        "\n",
        "#x, y 座標上で時間tを変化させる\n",
        "fig = plt.figure()\n",
        "artists = []\n",
        "\n",
        "#for t in t_range:\n",
        "#  v1 = np.cos(omega*t - beta*x_range) \n",
        "#  v2 = - np.cos(omega*t + beta*x_range)\n",
        "#  v = v1+v2\n",
        "#  im1 = plt.plot(x_range,v, color = \"blue\")\n",
        "#  artists.append(im1)\n",
        "#ani = animation.ArtistAnimation(fig, artists,50)\n",
        "\n",
        "#rc('animation', html='jshtml')\n",
        "\n",
        "#plt.close()\n",
        "#ani\n",
        "\n",
        "\n",
        "v1 = np.cos(omega*Y - beta*X) \n",
        "v2 = - np.cos(omega*Y + beta*X)\n",
        "\n",
        "v3 = np.cos(omega*1 - beta*(np.sqrt(X*X + Y*Y)))\n",
        "\n",
        "\n",
        "\n",
        "v = v1+v2\n",
        "\n",
        "plt.contour(X, Y, v,20)\n",
        "plt.colorbar()\n",
        "plt.show()\n",
        "\n",
